    false,nt"url": null,nt"notes": "This draft environmental assessment (EA)
    discusses management trapping of furbearers and predators on areas of Lacreek National
    Wildlife Refuge in Bennett County, South Dakota to provide optimum wildlife habitat
    for migratory birds and other wildlife species. It is not expected, or desired,
    to extirpate predator and furbearer populations from the area. The desire is to
    control these populations within objective levels that the system can support in
    conjunction with a variety of other species.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
